class GulshanModel {
  GulshanModel({
      bool? success, 
      num? status, 
      String? message, 
      List<Body>? body,}){
    _success = success;
    _status = status;
    _message = message;
    _body = body;
}

  GulshanModel.fromJson(dynamic json) {
    _success = json['success'];
    _status = json['status'];
    _message = json['message'];
    if (json['body'] != null) {
      _body = [];
      json['body'].forEach((v) {
        _body?.add(Body.fromJson(v));
      });
    }
  }
